    <title>Relevos CDU Granada Masters</title>
    <style>
      body {
          font-family: Arial, sans-serif;
          margin: 20px;
      }
      #homeButton {
          font-size: 2em;
          text-decoration: none;
          display: block;
          margin-bottom: 20px;
          width: 50px;
          text-align: left;
      }
      #logo {
          width: 200px;
          margin-bottom: 20px;
      }
      /* Button styles (only for Filter button) */
      #filterButton {
          padding: 10px 15px;
          font-size: 1em;
          border: none;
          border-radius: 5px;
          cursor: pointer;
          margin-right: 10px;

          color: black;
          font-weight: bold;
      }

      #filterButton {
          background-color: #28a745; 
      }

      #filterButton:hover {
          background-color: #218838;
      }
      
      /* Table styles for Swimmer Availability */
      table {
          width: 400px; 
          border-collapse: collapse;
          margin-top: 20px;
          font-size: 1.1em;
      }
      th, td {
          border: 1px solid #ccc;
          padding: 10px;
          text-align: left;
      }
      th {
          background-color: #007bff;
          color: white;
      }
      td:last-child {
          text-align: center;
      }
      
      /* Styling for Relay Results */
      #relayResults h2 {
          color: #007bff;
          border-bottom: 2px solid #ccc;
          padding-bottom: 5px;
          margin-top: 30px;
      }
      #relayResults p {
          line-height: 1.4;
      }

      // =========================================================================

      let rawSwimmerData = [];
      let headers = [];
      let isFiltered = false; 

      // --- SWIMMERS AVAILABILITY FUNCTIONS (Unchanged) ---
      
      function saveAvailability(swimmerName, isChecked) {
          try {
              localStorage.setItem(`availability_${swimmerName}`, isChecked);
          } catch (e) {
              console.error("Error saving to local storage:", e);
          }
      }

      function loadAvailability(swimmerName) {
          return localStorage.getItem(`availability_${swimmerName}`);
      }
      
      function loadSwimmerData() {
          fetch(SHEET_URL)
              .then(response => {
                  if (!response.ok) {
                      throw new Error('Network response was not ok');
                  }
                  return response.text();
              })
              .then(csvText => {
                  const lines = csvText.trim().split("\n");
                  if (lines.length === 0) return;

                  headers = lines[0].split(",").slice(0, 13);
                  rawSwimmerData = lines.slice(1).map(line => line.split(",").slice(0, 13));

                  renderAvailabilityTable();
              })
              .catch(error => {
                  console.error('Error fetching data from Google Sheet:', error);
                  document.getElementById('swimmerData').innerHTML = '<p style="color:red; font-weight:bold;">‚ö†Ô∏è Error al cargar los datos. Por favor, aseg√∫rese de que la hoja de c√°lculo es p√∫blica.</p>';
              });
      }
      
      function toggleFilter() {
          isFiltered = !isFiltered;
          renderAvailabilityTable();
          
          const button = document.getElementById('filterButton');
          if (isFiltered) {
              button.textContent = 'Mostrar TODOS';
              button.style.backgroundColor = '#dc3545';
          } else {
              button.textContent = 'Mostrar S√ìLO Disponibles';
              button.style.backgroundColor = '#28a745';
          }
      }

      function renderAvailabilityTable() {
          if (rawSwimmerData.length === 0) return;

          const swimmerNameIndex = 0;
          const availabilityHeader = headers[12];
          
          const dataToRender = rawSwimmerData.filter(row => {
              const swimmerName = row[swimmerNameIndex].replace(/"/g, ''); 
              const savedState = loadAvailability(swimmerName);
              const isChecked = savedState === 'true';

              return !isFiltered || isChecked; 
          });
          
          let tableHTML = '<table><thead><tr>';
          tableHTML += `<th>${headers[swimmerNameIndex]}</th>`;
          tableHTML += `<th>${availabilityHeader}</th>`;
          tableHTML += '</tr></thead><tbody>';

          dataToRender.forEach(row => {
              const swimmerName = row[swimmerNameIndex].replace(/"/g, '');
              const savedState = loadAvailability(swimmerName);
              let isChecked = savedState === 'true';

              tableHTML += '<tr>';
              tableHTML += `<td>${swimmerName}</td>`;
              
              tableHTML += `<td>
                                <input type="checkbox" 
                                       id="check_${swimmerName.replace(/\s/g, '_')}"
                                       ${isChecked ? 'checked' : ''}
                                       onchange="saveAvailability('${swimmerName}', this.checked)">
                              </td>`;
              
              tableHTML += '</tr>';
          });

          tableHTML += '</tbody></table>';
          document.getElementById('swimmerData').innerHTML = tableHTML;
      }

      // --- NEW RELAY FILTERING LOGIC ---

      function filterRelays() {
          const gender = document.getElementById('genderFilter').value;
          const event = document.getElementById('eventFilter').value;
          const ageGroup = document.getElementById('ageFilter').value;

          let filteredData = RELAY_DATA;

          // 1. Apply Filters
          if (gender !== 'ALL') {
              filteredData = filteredData.filter(team => team.gender_code === gender);
          }
          if (event !== 'ALL') {
              filteredData = filteredData.filter(team => team.event === event);
          }
          if (ageGroup !== 'ALL') {
              filteredData = filteredData.filter(team => team.age_group === ageGroup);
          }
          
          // 2. Group by Category (Gender, Event, Age Group) and find Top 3
          const groupedResults = filteredData.reduce((acc, team) => {
              const key = `${team.gender_label} | ${team.event} | Edad Total ${team.age_group}`;
              
              // Key ensures only one team shows per category/age combination
              if (!acc[key]) {
                  // Sort by time_seconds ascending (already sorted in Python, but good measure)
                  acc[key] = [];
              }
              
              // Only keep the top 3 best teams for each category
              if (acc[key].length < 3) {
                  acc[key].push(team);
              }
              return acc;
          }, {});

          renderRelayResults(groupedResults);
      }

      function renderRelayResults(groupedResults) {
          const resultsDiv = document.getElementById('relayResults');
          let html = '';

          const categories = Object.keys(groupedResults).sort();

          if (categories.length === 0) {
              resultsDiv.innerHTML = '<p>No se encontraron equipos para los filtros seleccionados.</p>';
              return;
          }

          for (const key of categories) {
              const teams = groupedResults[key];
              
              html += `<h2>${key}</h2>`;
              
              teams.forEach((team, index) => {
                  let swimmersStr = '';
                  // Medley order is hardcoded: Espalda (E), Braza (B), Mariposa (M), Libre (L)
                  if (team.event.includes('Medley')) {
                      const strokes = ["(Espalda)", "(Braza)", "(Mariposa)", "(Libre)"];
                      swimmersStr = team.swimmers.map((name, i) => `${name} ${strokes[i]}`).join(" -> ");
                  } else {
                      swimmersStr = team.swimmers.join(", ");
                  }

                  html += `
                      <p style="margin-left: 20px;">
                          <strong>${index + 1}. Tiempo: ${team.time_formatted}</strong> (Edad Total: ${team.total_age})<br>
                          Equipo: ${swimmersStr}
                      </p>
                  `;
              });
              html += '<hr>'; 
          }

          resultsDiv.innerHTML = html;
      }

      // Start the data loading process when the page loads and attach button listeners
      document.addEventListener('DOMContentLoaded', () => {
          loadSwimmerData();
          document.getElementById('filterButton').addEventListener('click', toggleFilter);
          
          // If RELAY_DATA is not empty, run the initial relay filter and display
          if (RELAY_DATA && RELAY_DATA.length > 0) {
              filterRelays();
          } else {
              document.getElementById('relayResults').innerHTML = '<p style="color:red;">‚ö†Ô∏è **Error:** Los datos de relevos no han sido cargados. Ejecuta el script de Python y pega el JSON en la variable `RELAY_DATA`.</p>';
          }
      });
    </script>
